import React from 'react'

class UserInput extends React.Component {
  render() {

    return( <div>
        <h1>Users</h1>
        <form>
        <input 
          type="text"
          name="nameFirst"
          value={this.props.nameFirst}
          onChange={this.props.handleChange}
        />
        <input
          type="text"
          name="nameLast"
          value={this.props.nameLast}
          onChange={this.props.handleChange}
        />
        <input
          type="text"
          name="nameAddress"
          value={this.props.nameAddress}
          onChange={this.props.handleChange}
        />
        <input
          type="text"
          name="nameCity"
          value={this.props.nameCity}
          onChange={this.props.handleChange}
        />
        <input
          type="text"
          name="nameState"
          value={this.props.nameState}
          onChange={this.props.handleChange}
        />
        <input
          type="number"
          name="nameZipcode"
          value={this.props.nameZipcode}
          onChange={this.props.handleChange}
        />
        <input
          type="email"
          name="nameEmail"
          value={this.props.nameEmail}
          onChange={this.props.handleChange}
        />
        </form>
        </div>)
  }
}

export default UserInput;
